import React from "react";
import Quote from "./Quote";
import Image from "./Image";

function Content(image, direction, quote) {
  console.log(image.image);

  if (direction === "Right") {
    return (
      <div className="content">
        <Quote quote={quote} />
        <Image image={image.image} />
      </div>
    );
  }
  return (
    <div className="content">
      <Image image={image} />
      <Quote quote={quote} />
    </div>
  );
}

export default Content;
